import React from "react";
import ReactDOM from "react-dom";
import "./Playlist.css";
import SideBar from "../SideBar/SideBar";
import Header from "../Header/Header";
import Card from "../MainComp/Body/Card/Card";
export default function Playlist(){

window.addEventListener("load",()=>{
    const obj = JSON.parse(localStorage.getItem("1"));
    ReactDOM.render(
        <Card img={obj.img} title={obj.ttile} artist={obj.artist} src={obj.src} />,
         document.getElementById("p-result")
    )
})

    return(
        <>
         <div className="main">
            <div className="p">
                 <h1 style={{color:"darkgray"}}>You don't have any Playlist Currently !</h1>
                  <div className="p-result" id="p-result">
                    
                  </div>
            </div>
            <Header />
            <SideBar />
         </div>
        </>
    )
}
